import "../styles/teachers.css";
const teachers = [
    {
        name: "Abner Cruz",
        image: "/teachers/AbnerCruz.png",
        disciplines: ["Matemática", "Física"],
    },
    {
        name: "Renata Nóbrega",
        image: "/teachers/RenataNobrega.png",
        disciplines: ["Piano", "Teclado", "Violino", "Violão"],
    },
];

function MathTeachers() {
    const mathTeachers = teachers.filter((t) => t.disciplines.includes("Matemática"));

    return (
        <section>
            <h2>Professores de Matemática</h2>
            <div className="galaxy-grid">
                {mathTeachers.map((teacher, index) => (
                    <div className="galaxy-card card" key={index}>
                        <img src={teacher.image} alt={teacher.name} style={{ borderRadius: "12px", width: "100%", marginBottom: "10px" }} />
                        <h3>{teacher.name}</h3>
                        <p>Especialista em Matemática</p>
                    </div>
                ))}
            </div>
        </section>
    );
}

function Teachers() {
    return (
        <div className="HomePageGlobalDiv">
            <div className="NousNovaTeachers">
                <h2>Professores</h2>
                <ul>
                    {teachers.map((teacher, index) => (
                        <li key={index} className="firstListContainer">
                            <div id="teacher">
                                <img src={teacher.image}></img>
                                <h3>{teacher.name}</h3>
                            </div>
                            <ul>
                                <h4>Disciplinas</h4>
                                {teacher.disciplines.map((discipline, i) => (
                                    <li key={i} className="secondListContainer">{discipline}</li>
                                ))}
                            </ul>
                        </li>
                    ))}
                </ul>
            </div>
        </div>
    );
}

export default Teachers;
